import React from 'react'
import "./Footer.css";

const Footer = () => {

    return (
        <div className="footer">
                <div className="footer-copyright">
                    <p>Logo and clipart by Gilead.</p>
                    <p>Copyright @ 2024 - All Rights Reserved.</p>
                    <p>"Game Savage" logos by Igor Mugerza.</p>
                </div>
                
            </div>
    
    )
}

export default Footer;
